import { FINISH_CREATE_QUIZ, CRETAE_QUIZ_QUESTION } from "./actionTypes"

export function createQuizQuestion(item) {
    return {
        type: CRETAE_QUIZ_QUESTION
    }
}

export function finishCreateQuiz() {
    return {
        type: FINISH_CREATE_QUIZ
    }
}
